ُ بالجهةِ المرادِ التّحدّثَ عنْها </span><span style=\\\"color:#0086ff\\\">-</span></span></p>\\n\\n<p style=\\\"text-align:right\\\"> </p>\\n\\n<p style=\\\"text-align:right\\\"><span style=\\\"font-size:1.25em\\\">.<span style=\\\"color:#0086ff\\\">صلبُ الموضوعِ:</span><span style=\\\"color:#000000\\\"> تعدادُ المهامِ الّتي يجبُ أنْ تقومَ بِها تلكَ الجهةُ الموكّلةُ بخدمةِ الشّعبِ </span><span style=\\\"color:#0086ff\\\">-</span></span></p>\\n\\n<p style=\\\"text-align:right\\\"><span style=\\\"font-size:1.25em\\\"><span style=\\\"color:#000000\\\"> (.......رئيسُ الحكومةِ، وزيرُ الصّحّةِ، الدّفاعُ المدنيُّ، الجيشُ)</span></span></p>\\n\\n<p style=\\\"text-align:right\\\"> </p>\\n\\n<p style=\\\"text-align:right\\\"><span style=\\\"font-size:1.25em\\\"><span style=\\\"color:#000000\\\">.</span><span style=\\\"color:#0086ff\\\">الخاتمةُ:</span><span style=\\\"color:#000000\\\"> ذكرُ القيمِ الّتي يجبُ أنْ تتحلّى بها فئاتُ المجتمعِ والمسؤولينَ معًا </span><span style=\\\"color:#0086ff\\\">-</span></span></p>\\n\\n<p style=\\\"text-align:right\\\"> </p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Text غير معنون\",\"authors\":[],\"changes\":[]},\"subContentId\":\"4e450704-1f50-4d58-87b1-7c7ffb2bb1f4\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.153846153846154,\"y\":83.41880341880342,\"width\":7.990867579908676,\"height\":14.202820903094874,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"decorative\":false,\"contentName\":\"الصورة\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAdIAAAHSCAYAAAEvZ3qgAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAAFxEAABcRAcom8z8AAH90SURBVHhe7Z0HmCxF1feb14QoiAJGQKIKKooEs/iZXrMCkkRQQFBRVETEPN6dru7ZG7hcJIgJA4iCiAKiV0CQZEIk+ErOOYebd6dOf+dUV++dma2e6Z7YM/P/Pc9/Z6enqjpV1alcXt9YRE/zQvqQF+iLvCCK4k/az1tAT7cuhpRFtIE3V26oDVXkc/rdNqSCUoqePPviibwTozWt
